import{ApolloClient}from"apollo-client";import{InMemoryCache}from"apollo-cache-inmemory";import{withClientState}from"apollo-link-state";import{ApolloLink}from"apollo-link";import{typeDefs,defaults,resolvers}from"./clientState";const cache=new InMemoryCache,stateLink=withClientState({cache:cache,typeDefs:typeDefs,defaults:defaults,resolvers:resolvers}),client=new ApolloClient({cache:cache,link:ApolloLink.from([stateLink])});export default client;